import RenderResult from "./RenderResult";
import { useContext } from "react";
import APIContext from "../store/APIContext";
//======================

const ResultList = () => {
    const dataSearch=useContext(APIContext)
    console.log(dataSearch.link_API[0].results)
  return (
    <RenderResult
    key={dataSearch.link_API[0].results.id}
              id={dataSearch.link_API[0].results.id}
              imgPoster={`
              https://image.tmdb.org/t/p/original${
                props.title === "fetchNetflixOriginals"
                  ? dataSearch.link_API[0].results.poster_path
                  : dataSearch.link_API[0].results.backdrop_path
                  ? dataSearch.link_API[0].results.backdrop_path
                  : dataSearch.link_API[0].results.poster_path
              }`}
              imgBackdropDetail={dataSearch.link_API[0].results.backdrop_path}
              name={dataSearch.link_API[0].results.title ? dataSearch.link_API[0].results.title : dataSearch.link_API[0].results.name}
              releaseDate={dataSearch.link_API[0].results.release_date}
              
  ></RenderResult>
  );
  
};
export default ResultList;
